import pygame
import random
import sys
import base64
from io import BytesIO
import ctypes
from pygame.locals import *

# Configurações do jogo
largura_tela = 1000
altura_tela = 400
cor_fundo = (255, 253, 208)
cor_botao = (0, 128, 0)
cor_texto = (255, 255, 255)
cor_preto = (0, 128, 0)
cor_preto1 = (0,0,0)
cor_azul = (5,79,119)

# imagem de fundo
imagem_base64 = ""

imagem_bytes = base64.b64decode(imagem_base64)
imagem_io = BytesIO(imagem_bytes)
fundo2 = pygame.image.load(imagem_io)

icon_path = 'iconecolorido.ico'
ctypes.windll.shell32.SetCurrentProcessExplicitAppUserModelID(icon_path)


pygame.init()

tela = pygame.display.set_mode((largura_tela, altura_tela))
pygame.display.set_caption("Jogo Educacional de Matemática")

fonte_pergunta = pygame.font.Font(None, 36)
fonte_resposta = pygame.font.Font(None, 28)

def exibir_mensagem(texto, niveis):
    while True:



        pos_x = largura_tela // 2 - fundo2.get_width() // 2
        pos_y = altura_tela // 2 - fundo2.get_height() // 2
        tela.blit(fundo2, (pos_x, pos_y))

        # Desenhe o botão "Clique aqui para jogar"
        botao_jogar_x1 = largura_tela // 2 - 400
        botao_jogar_y1 = altura_tela // 2 - 175
        botao_jogar_largura1 = 800
        botao_jogar_altura1 = 50
        pygame.draw.rect(tela, cor_azul, (botao_jogar_x1, botao_jogar_y1, botao_jogar_largura1, botao_jogar_altura1))

        # Desenhe o botão "Clique aqui para jogar"
        botao_jogar_x2 = largura_tela // 2 - 440
        botao_jogar_y2 = altura_tela // 2 + 12
        botao_jogar_largura2 = 880
        botao_jogar_altura2 = 105
        pygame.draw.rect(tela, cor_azul, (botao_jogar_x2, botao_jogar_y2, botao_jogar_largura2, botao_jogar_altura2))


        largura_botao = 200
        altura_botao = 50
        espacamento_botao = 20
        num_niveis = len(niveis)
        total_largura_botoes = (largura_botao + espacamento_botao) * num_niveis - espacamento_botao
        pos_x_inicial = (largura_tela - total_largura_botoes) // 2
        pos_y = altura_tela // 2 - altura_botao // 2 + 50

        for i, nivel in enumerate(niveis):
            cor_botao = cor_preto if nivel['disponivel'] else (225, 0, 0)
            pygame.draw.rect(tela, cor_botao, (pos_x_inicial + i * (largura_botao + espacamento_botao), pos_y, largura_botao, altura_botao))

            fonte = pygame.font.Font(None, 24)
            texto_botao = fonte.render(nivel['texto'], True, cor_fundo if nivel['disponivel'] else cor_texto)
            pos_texto_botao = texto_botao.get_rect(center=(pos_x_inicial + i * (largura_botao + espacamento_botao) + largura_botao // 2, pos_y + altura_botao // 2))
            tela.blit(texto_botao, pos_texto_botao)

            if nivel['disponivel']:
                nota = nivel['acertos'] / nivel['total_perguntas']
                texto_nota = fonte.render(f"Nota: {int(nota * 10)}", True, cor_texto)
                pos_texto_nota = texto_nota.get_rect(center=(pos_x_inicial + i * (largura_botao + espacamento_botao) + largura_botao // 2, pos_y + altura_botao // 2 + 45))
                tela.blit(texto_nota, pos_texto_nota)

        # Desenhe a mensagem sobre o botão
        mensagem = fonte_pergunta.render("Bem-vindo ao jogo de Matemática para a 4ª serie do fundamental!", True, cor_texto)
        pos_mensagem = mensagem.get_rect(center=(largura_tela // 2, altura_tela // 2 - 150))
        tela.blit(mensagem, pos_mensagem)

        fonte_desc = pygame.font.Font(None, 15)
        mensagem2 = fonte_desc.render("Code Crusaders - V 2.1 ", True, cor_texto)
        pos_mensagem2 = mensagem2.get_rect(center=(largura_tela // 2 + 380, altura_tela // 2 + 190))
        tela.blit(mensagem2, pos_mensagem2)

        pygame.display.flip()

        for evento in pygame.event.get():
            if evento.type == pygame.QUIT:
                pygame.quit()
                sys.exit()
            elif evento.type == pygame.MOUSEBUTTONDOWN:
                mouse_x, mouse_y = pygame.mouse.get_pos()
                for i, nivel in enumerate(niveis):
                    botao_x = pos_x_inicial + i * (largura_botao + espacamento_botao)
                    botao_y = pos_y
                    if botao_x <= mouse_x <= botao_x + largura_botao and botao_y <= mouse_y <= botao_y + altura_botao:
                        if nivel['disponivel']:
                            return nivel['numero']



def exibir_pergunta(pergunta):
    pos_x = largura_tela // 2 - fundo2.get_width() // 2
    pos_y = altura_tela // 2 - fundo2.get_height() // 2
    tela.blit(fundo2, (pos_x, pos_y))

    retangulo_pergunta = pygame.Rect(25, 30, largura_tela - 50, 80)
    pygame.draw.rect(tela, cor_preto, retangulo_pergunta)

    texto_pergunta = fonte_pergunta.render(pergunta, True, cor_texto)
    pos_texto_pergunta = texto_pergunta.get_rect(center=retangulo_pergunta.center)
    tela.blit(texto_pergunta, pos_texto_pergunta)

    pygame.display.flip()

    resposta = ""
    input_ativo = True

    while input_ativo:
        for evento in pygame.event.get():
            if evento.type == pygame.QUIT:
                pygame.quit()
                sys.exit()
            elif evento.type == pygame.KEYDOWN:
                if evento.key == pygame.K_RETURN:
                    input_ativo = False
                elif evento.key == pygame.K_BACKSPACE:
                    resposta = resposta[:-1]
                elif evento.unicode.isnumeric():
                    resposta += evento.unicode

        pos_x = largura_tela // 2 - fundo2.get_width() // 2
        pos_y = altura_tela // 2 - fundo2.get_height() // 2
        tela.blit(fundo2, (pos_x, pos_y))

        pygame.draw.rect(tela, cor_azul, retangulo_pergunta)
        tela.blit(texto_pergunta, pos_texto_pergunta)

        texto_resposta = fonte_resposta.render(resposta, True, cor_texto)
        pos_texto_resposta = texto_resposta.get_rect(center=(largura_tela // 2, altura_tela // 2))
        retangulo_resposta = pygame.Rect(450, altura_tela // 2 - 25, largura_tela - 900, 50)
        pygame.draw.rect(tela, cor_azul, retangulo_resposta)
        tela.blit(texto_resposta, pos_texto_resposta)

        pygame.display.flip()

    return resposta

def exibir_verificar(texto, cor):
    mensagem = fonte_pergunta.render(texto, True, cor)
    pos_x = largura_tela // 2 - fundo2.get_width() // 2
    pos_y = altura_tela // 2 - fundo2.get_height() // 2
    tela.blit(fundo2, (pos_x, pos_y))
    tela.blit(mensagem, (200, 200))
    pygame.display.flip()
    pygame.time.delay(2000)

def verificar_resposta(resposta, resposta_correta):
    if resposta == resposta_correta:
        exibir_verificar("Resposta correta!", (0, 128, 0))
        return True
    else:
        exibir_verificar("Resposta incorreta. Tente novamente.", (225, 0, 0))
        return False

def gerar_pergunta(nivel):
    operacoes = ["adição", "subtração", "multiplicação", "divisão"]
    operacao = random.choice(operacoes)
    num1 = random.randint(1, 100)
    num2 = random.randint(1, 50)
    while num1 <= num2:
        num1 = random.randint(50, 100)

    if nivel == 1:
        pergunta = f"Quanto é {num1} + {num2}?"
        resposta_correta = str(num1 + num2)
    elif nivel == 2:
        pergunta = f"Quanto é {num1} - {num2}?"
        resposta_correta = str(num1 - num2)
    elif nivel == 3:
        pergunta = f"Quanto é {num1} * {num2}?"
        resposta_correta = str(num1 * num2)
    else:
        pergunta = f"Quanto é {num1} / {num2}? (resposta arredondada para o inteiro mais próximo)"
        resposta_correta = str(round(num1 / num2))

    return pergunta, resposta_correta

def jogo_educacional():
    niveis = [{'numero': 1, 'texto': 'Nível 1', 'disponivel': True, 'acertos': 0, 'total_perguntas': 10},
              {'numero': 2, 'texto': 'Nível 2', 'disponivel': False, 'acertos': 0, 'total_perguntas': 10},
              {'numero': 3, 'texto': 'Nível 3', 'disponivel': False, 'acertos': 0, 'total_perguntas': 10},
              {'numero': 4, 'texto': 'Nível 4', 'disponivel': False, 'acertos': 0, 'total_perguntas': 10}]

    nivel_atual = exibir_mensagem("Escolha o nível:", niveis)

    num_perguntas = 10
    num_acertos = 0

    while nivel_atual <= len(niveis):
        perguntas_respondidas = 0
        acertos_nivel = 0

        while perguntas_respondidas < num_perguntas:
            pergunta, resposta_correta = gerar_pergunta(nivel_atual)
            resposta = exibir_pergunta(pergunta)
            if verificar_resposta(resposta, resposta_correta):
                acertos_nivel += 1
                num_acertos += 1
            perguntas_respondidas += 1

        niveis[nivel_atual - 1]['acertos'] = acertos_nivel

        if acertos_nivel >= 5:
            niveis[nivel_atual]['disponivel'] = True
            if nivel_atual == 1:
                exibir_verificar("Parabéns! Você desbloqueou o Nível 2.", (0, 128, 0))
                nivel_atual = exibir_mensagem("Escolha o nível:", niveis)
            elif nivel_atual == 2:
                exibir_verificar("Parabéns! Você desbloqueou o Nível 3.", (0, 128, 0))
                nivel_atual = exibir_mensagem("Escolha o nível:", niveis)
            elif nivel_atual == 3:
                exibir_verificar("Parabéns! Você desbloqueou o Nível 4.", (0, 128, 0))
                nivel_atual = exibir_mensagem("Escolha o nível:", niveis)
            else:
                exibir_verificar("Parabéns! Você completou todos os níveis.", (0, 128, 0))
        else:
            exibir_verificar("Você não acertou o suficiente para desbloquear o próximo nível.", (225, 0, 0))
            nivel_atual = exibir_mensagem("Tente novamente:", niveis)

    pygame.quit()

jogo_educacional()
